public class InsulinaType {

	/**
	 * 
	 */
	
	private String id;
	private String valor;
	
	
	
	
	/**
	 * @param id
	 * @param valor
	 */
	public InsulinaType(String id, String valor) {
		super();
		this.id = id;
		this.valor = valor;
	}

	public InsulinaType() {
		// TODO Auto-generated constructor stub
	}

	/**
	 * @return the id
	 */
	public String getId() {
		return id;
	}

	/**
	 * @param id the id to set
	 */
	public void setId(String id) {
		this.id = id;
	}

	/**
	 * @return the valor
	 */
	public String getValor() {
		return valor;
	}

	/**
	 * @param valor the valor to set
	 */
	public void setValor(String valor) {
		this.valor = valor;
	}
	
	

}
